    float: right;
    position: fixed;
    top: 75%; right: 5%;
    margin-right: 3%;
}
.quick_btn a {
    width: 40px; height: 40px;
    box-sizing: border-box;
    display: inline-block;
    border-radius: 50%;
    overflow: hidden;
    text-align: center;
    font-size: 25px;
    position: absolute;
}
.quick_btn a:first-child {
    background-image: url(./images/kakao0.jpg);
    background-size: 100%;
    background-position-x: -2px;
    animation: kakao 2s infinite linear;
    position: absolute;
    top: 0; left: 0;
    border: 0;
    box-shadow: 3px 3px 3px #666;
}
@keyframes kakao {
    from { 
        top: 0;
    }
    50% {
        top: 5px;
    }
    to {
        top: 0;
    }
}
.quick_btn a:nth-child(2) {
    top: 50px; left: 0;
    background-color: #eee;
}
.quick_btn a:nth-child(3) {
    top: 95px; left: 0;
    background-color: #eee;
}
